import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { EmployeesCard } from "./components/EmployeesCard";
import { FiPlus } from "react-icons/fi";
import { NavLink } from "react-router-dom";
import { GirdAndListView } from "../../../../common/components/GirdAndListView/GirdAndListView";
import Photo from "../../../../common/components/img/Img";
import ProfilPhoto2 from "../../../../../pics/profile2.jpeg";
import { useNavigate } from "react-router-dom";

export const EmployeesManagement = () => {
  return (
    <>
      <div className="custom_container">
        <div className="row">
          <div className="col-xxl-9 col-xl-9 col-lg-9 col-md-6 col-sm-5 col-5">
            <TopPageTitle Name="Employeesâ€™ Management" />
          </div>
          <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-6 col-sm-7 col-7 MyAttendence_next_page">
            <NavLink to="/">
              <span>Add Employee</span>
              <FiPlus />
            </NavLink>
          </div>
        </div>

        <GirdAndListView
          GirdView={<EmployeesCard />}
          ListView={<EmployeesListView />}
        />
      </div>
    </>
  );
};

const EmployeesListView = (props) => {
  const AssetListData = [
    {
      Photo: ProfilPhoto2,
      Title: "react js developer",
      EmployeeName: "ashish kumar madaan",
      ContactNumber: "sunny@maxlence.com.au",
      EmailID: "+91 834 9933 768",
    },
  ];
  const AssetListApp = (props) => {
    return (
      <>
        <tr className="ApprovalDetailsPage_thead_td">
          <td className="upload_document_list_img_top_div">
            <ProfileIcon
              backgroundImage={props.Photo}
              className="upload_document_list_img"
            />
            {props.EmployeeName}
          </td>
          <td>{props.Title}</td>
          <td>{props.ContactNumber}</td>
          <td>{props.EmailID}</td>
        </tr>
      </>
    );
  };
  return (
    <>
      <div className="custom_container_iner">
        <div className="EmployeesDocument_top_title">
          <h3>Uploaded Document</h3>
        </div>
        <div>
          <div className="row g-3">
            <div className="col-xxl-2 col-xl-2 col-lg-2 col-md-6 col-sm-6 col-6">
              <div className="ApprovalDetailsPage_date_picker">
                <label>From</label>
                <Input type="date" className="form-control" />
              </div>
            </div>
            <div className="col-xxl-2 col-xl-2 col-lg-2 col-md-6 col-sm-6 col-6">
              <div className="ApprovalDetailsPage_date_picker">
                <label>to</label>
                <Input type="date" className="form-control" />
              </div>
            </div>

            <div className="col-xxl-8 col-xl-8 col-lg-8 col-md-12 col-sm-12 col-12 ApprovalDetailsPage_search_input">
              <div className="ApprovalDetailsPage_date_picker">
                <div className="ApprovalDetailsPage_search_input_iner_div">
                  <span>
                    <FontAwesomeIcon icon={faMagnifyingGlass} />
                  </span>
                  <Input
                    type="text"
                    className="form-control"
                    placeholder="Search"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="ApprovalDetailsPage_top_div">
          <table className="table table-hover upload_document_list_main_div text-center text-capitalize">
            <thead>
              <tr className="ApprovalDetailsPage_thead_tr ">
                <th scope="col" className="text-start">
                  <span className="new_application_table_filter_div">
                    Document Name
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
                <th scope="col">
                  <span className="new_application_table_filter_div">
                    Owner
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
                <th scope="col">
                  <span className="new_application_table_filter_div">
                    Last Updated
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
                <th scope="col">Action</th>
              </tr>
            </thead>
            <tbody>
              {AssetListData.map((val, i) => {
                return (
                  <AssetListApp
                    key={i}
                    Photo={val.Photo}
                    Title={val.Title}
                    EmployeeName={val.EmployeeName}
                    ContactNumber={val.ContactNumber}
                    EmailID={val.EmailID}
                  />
                );
              })}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};
